import Header from "./Header"
import Main from "./Main"

function ProtectedRouteContent({ userEmail, ...props }) {
    return(
        <>
          <Header dataUser={userEmail} />
          <Main
            name='main'
            {...props}
           />
        </>

    )
}

export default ProtectedRouteContent;
